I'm trying to create a rust app that can read the contents of the clipboard aloud using the elevenlabs.io API. I've been looking at the documentation for the API and the `clipboard` crate, but I'm not sure how to put it all together.

Here's what I've got so far:

```
use clipboard::ClipboardProvider;
use reqwest::Client;
use serde::Deserialize;
use std::error::Error;

#[derive(Deserialize)]
struct TextToSpeechResponse {
    text: String,
}

async fn read_clipboard_aloud() -> Result<(), Box<dyn Error>> {
    let client = Client::new();
    let clipboard = ClipboardProvider::new();

    let text = clipboard.get_contents()?;
    let response = client
        .post("https://api.elevenlabs.io/v1/text-to-speech/21m00Tcm4TlvDq8ikWAM")
        .header("xi-api-key", "YOUR_API_KEY")
        .json(&text)
        .send()
        .await?
        .json::<TextToSpeechResponse>()
        .await?;

    println!("{}", response.text);

    Ok(())
}

fn main() {
    let _ = read_clipboard_aloud().await;
}
```

This code will read the contents of the clipboard and print it to the console, but I'm not sure how to use the response from the API to play the audio.

Any help would be greatly appreciated!

